import '../styles/App.scss';
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <div>
      <body><Routes>
        <Route path='/' element={<><Header /><Main /></>}></Route></Routes></body>
    </div>
  );
}

export default App;
